            base.OnModelCreating(modelBuilder);
             //Set Composite key
             modelBuilder.Entity<EmployeeSkill>()
                 .HasKey(c => new{c.EmployeeCvId,c.SkillId});
             modelBuilder.Entity<EmployeeWorkDay>()
                 .HasKey(c => new {c.Day, c.EmployeeCvId});
             modelBuilder.Entity<EmployerSkill>()
                 .HasKey(c => new{c.EmployerJobProfileId,c.SkillId});
             modelBuilder.Entity<EmployerComplusoryWorkDay>()
                 .HasKey(c => new{c.Day,c.EmployerJobProfileId});
             modelBuilder.Entity<EmployerRequiredSchool>()
                 .HasKey(c => new{c.EmployerJobProfileId,c.SchoolId});
            modelBuilder.Entity<Message>()
                .HasKey(c => new {c.Id, c.ConversationId, c.SenderId, c.ReciverId});

             //Set unique key
             modelBuilder.Entity<Skill>()
                 .HasIndex(b => b.NormalizedName).IsUnique();
             modelBuilder.Entity<Field>()
                 .HasIndex(b => b.NormalizedName).IsUnique();
             modelBuilder.Entity<School>()
                 .HasIndex(c => new{c.DomainExtension,c.NormalizedName,c.SuburbId}).IsUnique();
             modelBuilder.Entity<Invatation>()
                 .HasIndex(c => new{c.EmployeeCvId,c.EmployerJobProfileId}).IsUnique();
            

